import { Image, StyleSheet, Text, View } from "react-native";

export default function Component() {
    return (
        <View>

            <Text style={cstyle.text}> I'm Child component </Text>
        </View>


    );
}
const cstyle = StyleSheet.create({
    text: {
        marginBottom: 30,
        fontSize: 30,
    },
    img:{
        width:300,
        height:300
    }
});
